import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
     <div className="whitebg-main">
      <h1>상상을</h1>
     </div>

     <div className="blackbg-main">
       <h1>현실로.</h1>
     </div>

     <div className="main-bg">
        <div>
         <h3>상상을 현실로<br />만드는 개발자</h3>
         <h2>최원석입니다.</h2>
        </div> 
     </div>
    </div>
  );
}

export default App;
